// CHALLENGE: uncomment the code below and see the car stats rendered
import React from "react";
import ReactDOM from "react-dom";
import cars, {useCars} from "./practice";

const [honda, tesla] = cars;  //destructing an array

const {speedStats: {topSpeed: hondTopSpeed}} = Honda;
const {model, colourByPopularity, speedStats} = Tesla;
function Cars(props) {
    return (
        <div>
         <cars 
            model={cars.model}
            color={cars.colourByPopularity[0].colourByPopularity}
            speed={cars.speedStats}
         />   
        </div>
    )
}

ReactDOM.render(
  <table>
    <tr>
      <th>Brand</th>
      <th>Top Speed</th>
      <th>Top Color</th>
    </tr>
    <tr>
      <td>{Cars.model}</td>
      <td>{Cars.speedStats[1]}</td>
      <td>{Cars.colourByPopularity}</td>
    </tr>
    <tr>
      <td>{Cars.model}</td>
      <td>{Cars.speedStats[1]}</td>
      <td>{Cars.color[0]}</td>
    </tr>
  </table>,
  document.getElementById("root")
);
